import './ShopCategorias.css';

const ShopCategorias = () => {
  return (
    <div class="shopCatC">
      <h3>filtros de su compra</h3>
      <ul>
        <li>ordenar por nombre alfabetico descendente</li>
        <li>ordenar por nombre alfabetico ascendente</li>
        <li>ordenar por mayor precio</li>
        <li>ordenar por menor precio</li>
        <li>filtrar por ofertas especiales</li>
        <li>filtrar por top comprados del mes</li>
      </ul>
    </div>
  );
}

export default ShopCategorias;
